import React, { useEffect } from 'react';

const AdobePDFViewer = () => {
  useEffect(() => {
    const script = document.createElement('script');
    script.src = 'https://documentcloud.adobe.com/view-sdk/main.js';
    script.async = true;
    document.body.appendChild(script);

    script.onload = () => {
      const adobeDCView = new window.AdobeDC.View({ clientId: 'YOUR_CLIENT_ID', divId: 'adobe-dc-view' });
      adobeDCView.previewFile({ content: { location: { url: 'https://example.com/your-pdf.pdf' } } });
    };
  }, []);

  return <div id="adobe-dc-view"></div>;
};

export default AdobePDFViewer;
